import React from 'react';
import { FaFacebook, FaTwitter } from 'react-icons/fa'; // Ensure you have react-icons installed

const Footer: React.FC = () => {
  return (
    <footer>
      <div>
        <p>Copyright Â© 2001-2024 The Quiz League of London (QLL) - www.quizleagueoflondon.co.uk</p>
        <p>Founded in 1990, The Quiz League of London (QLL) is an independent, non-profit-making association, owned and run by its member teams.</p>
        <p>Contact - Links - GDPR policy - Cookie policy - Sitemap - Admin</p>
      </div>
      <div className="social-links">
        <a href="https://www.facebook.com/yourpage" target="_blank" rel="noopener noreferrer">
          <FaFacebook size={24} />
        </a>
        <a href="https://www.twitter.com/yourpage" target="_blank" rel="noopener noreferrer">
          <FaTwitter size={24} />
        </a>
      </div>
    </footer>
  );
};

export default Footer;
